import React,{Component} from 'react';
import {
    CBadge,
    CCard,
    CCardBody,
    CCardHeader,
    CCol,
    CDataTable,
    CRow
  } from '@coreui/react'  
  import usersData from './users/UsersData'

  const getBadge = status => {
    switch (status) {
      case 'Active': return 'success'
      case 'Inactive': return 'secondary'
      case 'Pending': return 'warning'
      case 'Banned': return '<CButton>Test</CButton>'
      default: return 'primary'
    }
  }
  const fields = ['name','registered', 'role', 'status']
class NewVacancy extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (
            <CRow>
            <CCol>
              <CCard>
                <CCardHeader>
                  Combined All Table
                </CCardHeader>
                <CCardBody>
                <CDataTable
                  items={usersData}
                  fields={fields}
                  hover
                  striped
                  bordered
                  size="sm"
                  itemsPerPage={10}
                  pagination
                  scopedSlots = {{
                    'status':
                      (item)=>(
                        <td>
                          <CBadge color={getBadge(item.status)}>
                            {item.status}
                          </CBadge>
                        </td>
                      )
                  }}
                />
                </CCardBody>
              </CCard>
            </CCol>
          </CRow>
        );
    }
}

export default NewVacancy;
